import { Grid, GridItem } from '@chakra-ui/react'
import Card from "../../components/Card";


function Cardy() {
    return (
        <div>
       <Grid templateColumns='repeat(5, 1fr)' gap={6}>
  <GridItem w='100%' h='10' bg='blue.500' />
  <GridItem w='100%' h='10' bg='blue.500' />
  <GridItem w='100%' h='10' bg='blue.500' />
  <GridItem w='100%' h='10' bg='blue.500' />
  <GridItem w='100%' h='10' bg='blue.500' />
</Grid>

        </div>
    )
}
export default Cardy
